import React from "react";
import kafaImage from "../images/kafa3.jpg"; // prilagodi put prema stvarnoj lokaciji
import FlyInSection from "../components/FlyInSection.js";
const ThankYou = () => {
  return (
    <div
      style={{
        display: "flex",
        height: "100vh",
        fontFamily: "Arial, sans-serif",
        background: "#000"
      }}
    >
      {/* Lijeva polovina */}
      <FlyInSection>
      <div
        style={{
          flex: 1,
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          padding: "20px",
        }}
      >
        <h1>Hvala na narudžbi!</h1>
        <p>Vaša porudžbina je zaprimljena i uskoro će biti obrađena.</p>
      </div>

      {/* Desna polovina */}
      <div
        style={{
          flex: 1,
          backgroundImage: `url(${kafaImage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      /></FlyInSection>
    </div>
  );
};

export default ThankYou;
